import React from 'react';
import {Message} from 'Domain/Message';

interface Props {
    meinung: string;
    name: string;
}

function MessageView({meinung, name}: Props): JSX.Element {
    return (<><article>{meinung}</article><footer>{name}</footer></>)
}

export default MessageView;
